(1, 'Webinar Teknologi AI di Era Digital', 'Webinar yang membahas penerapan teknologi AI di berbagai bidang. Acara ini cocok untuk mahasiswa dan profesional yang ingin memahami peran AI dalam transformasi digital.', 'Artificial Intelligence (AI) telah menjadi bagian penting dalam perkembangan teknologi modern. Webinar ini menghadirkan pembicara ahli yang akan membahas bagaimana AI diterapkan dalam berbagai sektor, seperti industri, pendidikan, dan kesehatan. Peserta akan mendapatkan gambaran mengenai manfaat AI dalam meningkatkan efisiensi dan produktivitas.\\n\\nSelain itu, webinar ini juga membahas tantangan yang dihadapi dalam penerapan AI, termasuk isu etika dan regulasi yang muncul. Materi akan disampaikan dengan pendekatan praktis yang memudahkan peserta untuk memahami konsep-konsep teknis tanpa perlu latar belakang khusus di bidang teknologi.\\n\\nKegiatan ini diadakan secara daring melalui Zoom Meeting dan diakhiri dengan sesi tanya jawab interaktif. Peserta diharapkan dapat membawa wawasan baru tentang bagaimana AI dapat menjadi solusi di berbagai bidang kehidupan.', '2024-12-10', '10:00:00', 'Zoom Meeting', 1, 2, , 122, 'Aktif');
INSERT INTO `kegiatan` (`id_kegiatan`, `nama_kegiatan`, `deskripsi_singkat`, `deskripsi_lengkap`, `tanggal`, `waktu`, `lokasi`, `id_penyelenggara`, `id_kategori`, `foto`, `jumlah_peserta`, `status`) VALUES
(2, 'Lomba Coding Nasional 2024', 'Kompetisi coding bergengsi tingkat nasional untuk mahasiswa. Acara ini bertujuan menggali potensi teknologi dan kreativitas generasi muda.', 'Lomba Coding Nasional 2024 adalah ajang bergengsi bagi mahasiswa di seluruh Indonesia untuk menunjukkan keahlian mereka dalam bidang pemrograman. Kompetisi ini bertujuan untuk mendorong kreativitas dan inovasi dalam menciptakan aplikasi berbasis web atau mobile yang dapat menyelesaikan masalah nyata.\\n\\nSelama kompetisi, peserta akan diberi waktu 24 jam untuk mengembangkan aplikasi berdasarkan tema yang akan diumumkan di awal acara. Karya peserta akan dinilai berdasarkan beberapa aspek, seperti fungsionalitas, inovasi, desain, dan dampak aplikasinya terhadap pengguna. Juri yang berasal dari kalangan profesional industri teknologi akan memberikan evaluasi mendalam.\\n\\nSelain lomba utama, acara ini juga dilengkapi dengan sesi mentoring, di mana peserta dapat berdiskusi langsung dengan para ahli teknologi. Dengan lokasi di Laboratorium Komputer Fakultas Ilmu Komputer, acara ini diharapkan dapat menjadi wadah bagi generasi muda untuk mengeksplorasi potensi mereka dalam bidang teknologi.', '2024-12-20', '08:00:00', 'Laboratorium Komputer, Fakultas Ilmu Komputer', 1, 3, , 55, 'Aktif');

